import React from 'react';
import Button from 'react-bootstrap/Button';
import Logo from '../assets/Logo.png';

const Navigation = ({ onRouteChange }) => {
    const style = {borderBottom: "black solid 1px", display: "flex", justifyContent: "space-between"}

    return (
        <div className="p-3" style={this.style}>
            <img alt="" src={Logo} width="160px" />
            <Button variant="outline-danger" className="float-right" onClick={() => onRouteChange('signin')}>Sign Out</Button>
        </div>
    )
}

export default Navigation;
